import { FETCH_TODOS_1_SUCCESS, FETCH_TODOS_1_FAILED, FETCH_TODOS_1 } from "./action_types";

export const fetchTodos_1 = () => {
   dispatch({ type: FETCH_TODOS_1 });
   const TODOS_1_URL = "https://jsonplaceholder.typicode.com/todos";
   fetch(TODOS_1_URL)
      .then((response) => response.json())
      .then((data) => dispatch({ type: FETCH_TODOS_1_SUCCESS, payload: data }))
      .catch((err) => dispatch({ type: FETCH_TODOS_1_FAILED, payload: err }));
};
